import { useState, useEffect } from "react";

const ChatSkeleton = () => {
    const [chats, setChats] = useState([]);

    const API_URL = "http://127.0.0.1:8000/api/users/chats";

    useEffect(() => {
        const fetchChats = async () => {
            await fetch(API_URL).then(resp => resp.json()).then(data => {
                for (const item of data) {
                    setChats(Array(item));
                }
            })
        }
        fetchChats();
    }, []);


    return (
        <div>
            {chats.map((item, idx) => (
                <div key={idx} className="w-48 h-16 border-solid border-2 border-slate-300">
                    <span>{item.chat_name}</span>
                </div>
            ))}
        </div>
    )
};

export default ChatSkeleton;
